column4:
@YomogiMovie ポルトガルは食べ物も美味しいし、人も優しいし、見どころもたくさんあるのでオススメです👌

豪華絢爛できらびやかなものしか興味が無い方には物足りないと思いますが、しみじみヨーロッパの良さを感じられる、落ち着いた良いところです😊

機会があったら是非🤗

@bremen427 ナニコレ笑う〜🤣🤣🤣
これ着たら師匠と一体化というか、色んな人の心に爪痕を残してしまう💦

オッケー、たまにはイカれたことしたいので、楽しもう👍✨✨

@seven25798842 やっぱりアルコール有りなんだ🍷

海外行きたいでしょ？😢
ワクチン接種率が上がって欲しい😭

@YomogiMovie 高いのかもです🤔💸
外国でジャパンを感じられるとテンション上がりそうですね、いいないいな!!(外国行きたい)

ムジカフェというものがあるのですね！いまググってみたらビールとワインがあるようです✨

@seven25798842 ドイツはアメリカより物価が高いのかな？　米ムジは日本より僅かに高いと感じるくらい。
アロマの香り、ヒノキが焚かれていて「ここは安全ジャパン🇯🇵」て思って癒されてる✨

ほんと、お酒飲むスペースがあれば良いよね！日本のムジカフェってアルコールメニュー有るのかな？

@YomogiMovie ドイツに遊びに行った時、友達が無印もユニクロも高い〜なかなか買えない〜て嘆いてて今度遊び行ったら日本土産にしよかな、と思ったことを思い出しました💐

ジャズが流れるのお洒落です♪
無印にお酒が売ってれば店内で飲んでしまいそう…🦭🥃

@kodorasoshi ほんと、ムジとユニクロさんありがとうございます😭
ユニクロはWebで買うんだけど、限定Tシャツとかちょっと可愛いのは売ってないんですよ🥲

シンガポールの人ってムジ&amp;ユニクロ着てました？

@yu_ko02yu 商品ほぼ同じなの！食品類が少なくて残念なんだけど基礎化粧品も売ってるからありがたい。
値段が僅かに高いかな？

アロマ焚かれているのも一緒だよ🌸
